import React, { useLayoutEffect, useEffect, useState } from "react";
import {
  View,
  Text,
  Button,
  Image,
  Dimensions,
  TouchableOpacity,
  StyleSheet,
  ScrollView,
} from "react-native";
import axios from "axios";
import {
  Card,
  ListCard,
  ShopDes,
  ShopTitle,
  ShopDetailTitle,
} from "../assets/common/common";

import { photoShopDetail } from "./Home/photoShopDetail";
import { photoShopList } from "./Home/photoShopList";
import { SafeAreaView } from "react-native-safe-area-context";
import Icon from "react-native-vector-icons/MaterialCommunityIcons";
import styled, { withTheme } from "styled-components/native";
import { Rating, AirbnbRating } from "react-native-ratings";
import { createStackNavigator } from "@react-navigation/stack";

const Home = ({ navigation }) => {
  const Stack = createStackNavigator();
  const [photoShops, setPhotoShops] = useState();
  const showShopDetail = (seq) => {};

  useEffect(() => {
    axios({
      method: "get",
      url: "http://192.168.219.101:4000/getPhotoShop",
      responseType: "json",
    })
      .then(({ data, status }) => {
        if (status == 200) setPhotoShops(data);
      })
      .catch((res) => {
        console.log(res);
      });
  }, []);

  return (
    <Stack.Navigator screenOptions={{ headerShown: false }}>
      <Stack.Screen name="List" component={photoShopList} />
      <Stack.Screen
        name="Detail"
        photoShops={photoShops}
        component={photoShopDetail}
      />
    </Stack.Navigator>
  );
};

const { width } = Dimensions.get("window");

const styles = StyleSheet.create({
  container: { flex: 1, backgroundColor: "white" },
  child: { width, justifyContent: "center" },
  text: { fontSize: width * 0.5, textAlign: "center" },
});

export default Home;
